scriptlet.script:
try {
	subscriptionId = scriptletContext.get("subscriptionId");
	requestId = scriptletContext.get("requestId");
	var href;
	if( subscriptionId !== undefined && subscriptionId !== null) {
		href = JSP + "?subscriptionId=" + subscriptionId;
	}
	else if ( requestId !== undefined && requestId !== null) {
		href = JSP + "?requestId=" + requestId;
	}
	else {
		throw new Error("Both Subscription ID and Request ID are undefined");
	}
		scriptletContext.putGlobal("href",href);
		scriptletResponse="success";
}
catch(error) {
	scriptletResponse="failure";
	scriptletContext.put("FailureMessage",error);
}
